# Function to fetch data using a random user agent
async def fetch_data(session, url):
    headers = {'User-Agent': random.choice(USER_AGENTS)}  # Select a random user agent from the list
    async with session.get(url, headers=headers, timeout=30) as response:
        html_source = await response.text()

    if html_source:
        page_soup = soup(html_source, 'html.parser')
        buyer_agent_fee = page_soup.find('div', 
                                         class_='isDesktop inline-block').text.strip() if page_soup.find('div', 
                                                                                                         class_='isDesktop inline-block') else "N/A"
        listed_by = page_soup.find('span', 
                                   class_='agent-basic-details--broker').text.lstrip("â€¢ ").strip() if page_soup.find('span', 
                                                                                                                     class_='agent-basic-details--broker') else "N/A"
        return buyer_agent_fee, listed_by
    else:
        print("Failed to retrieve HTML source for", url)
        return "N/A", "N/A"

# Function to fetch data and update progress
async def fetch_data_and_update_progress(file_path, progress):
    try:
        df = pd.read_excel(file_path)
        total_rows = len(df)
        progress["maximum"] = total_rows

        async with aiohttp.ClientSession() as session:
            tasks = []
            for index, row in df.iterrows():
                url = row['URL (SEE https://www.redfin.com/buy-a-home/comparative-market-analysis FOR INFO ON PRICING)'] #name of column containing the urls to be scraped
                tasks.append(fetch_data(session, url))

            for index, task in enumerate(asyncio.as_completed(tasks)):
                buyer_agent_fee, listed_by = await task
                df.at[index, 'V'] = buyer_agent_fee 
                df.at[index, 'U'] = listed_by
                progress["value"] = index + 1

                delay = random.uniform(1, 5)  
                await asyncio.sleep(delay) 
                app.update_idletasks()

        desktop_path = os.path.join(os.path.join(os.environ['USERPROFILE']), 'Desktop')
        output_file_path = os.path.join(desktop_path, "New_countries_homes1.xlsx")
        df.to_excel(output_file_path, index=False)
        messagebox.showinfo("Success", "Data fetch and processing complete.")
    except Exception as e:
        messagebox.showerror("Error", str(e))

    progress["value"] = 0

# Function to execute fetch data
def execute_fetch_data():
    file_path = filedialog.askopenfilename(title="Select Excel File", filetypes=(("Excel files", "*.xlsx"), ("All files", "*.*")))
    if not file_path:
        messagebox.showwarning("Warning", "No file selected. Please select an Excel file.")
        return

    asyncio.run(fetch_data_and_update_progress(file_path, progress))

